import { Outlet } from 'react-router-dom';
import Sidebar from '../Sidebar';
import './index.scss';

const Layout = () => {
    return <>
        <Sidebar/>
        <div className='page'>
            <span className='tags top-tags'>&lt;body&gt;</span>
            <Outlet />
            <span className='tags bottom-tags'>
                &lt;/body&gt;
                <br />
            </span>
            <span className='bottom-tag-html'>
                &lt;/html&gt;
            </span>
        </div>
    </>
}

export default Layout;
